// import Index from "./Pages/RouterChallange/Index";
import axios from "axios";
import { useState, useEffect } from "react";

const options = {
  method: "GET",
  url: "https://visual-crossing-weather.p.rapidapi.com/forecast",
  params: {
    aggregateHours: "24",
    location: "Washington,DC,USA",
    contentType: "csv",
    unitGroup: "us",
    shortColumnNames: "0",
  },
  headers: {
    "X-RapidAPI-Key": "81d70b4329mshb68add759d57321p1e59e1jsn2506c33db28a",
    "X-RapidAPI-Host": "visual-crossing-weather.p.rapidapi.com",
  },
};

const App = () => {
  const [Data, SetData] = useState([]);

  useEffect(() => {
    const getData = async () => {
      try {
        const res = await instance.get("/");
        console.log(res);
        SetData(res.data);
      } catch (error) {}
    };
    getData();
  }, []);
  console.log(Data);
  return <div>aaa</div>;
};

export default App;
